import * as S from './hero.styles';
import * as GS from '../../styles/global';
import Link from 'next/link';

const Hero = ({ message, href, link }) => {
	return (
		<S.HeroBackground>
			<GS.MaxContainer>
				<S.Message>
					<h1>{message}</h1>
					<Link href={href}>
						<a>
							<GS.MainButton>{link}</GS.MainButton>
						</a>
					</Link>
				</S.Message>
			</GS.MaxContainer>
		</S.HeroBackground>
	);
};

export default Hero;
